import React from 'react';
import Case from './Case';


class Control extends React.Component{
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="bg:color:blue:8 end">
        <Case aorb="A bg:color:pink:5" oc="true" lol={this.props.lol}></Case>
        <Case aorb="A bg:color:deep-blue:6" oc="true"></Case>
        <Case aorb="A bg:color:yellow:6" oc="true"></Case>
        <Case aorb="A bg:color:green:8" oc="true"></Case>
        <Case aorb="A bg:color:orange:8" oc="true"></Case>
        <Case aorb="A bg:color:red:8" oc="true"></Case>
        <button type="button" name="button">return</button>
        <button type="button" name="button">GO</button>
      </div>
    );
  }
}

export default Control;
